const n={title:function(n){return`\n    <div class="row">\n     <div class="col-sm">\n      <h1>${n.value}</h1>\n     </div>\n    </div>\n    `},text:function(n){return`\n    <div class="row">\n     <div class="col-sm">\n      <p>${n.value}</p>\n     </div>\n    </div>\n    `},columns:function(n){return`\n    <div class="row">\n     ${n.value.map((n=>`<div class="col-sm">${n}</div>`)).join("")}\n    </div>\n    `},image:function(n){return`\n    <div class="row">\n    <img src="${n.value}">\n    </div>\n    `}},e=document.querySelector("#site");[{type:"title",value:"Hello World from JS!!!"},{type:"text",value:"Text from JS"},{type:"columns",value:["111111111","222222222","333333333"]},{type:"image",value:"./assets/font.jpg"}].forEach((t=>{const s=n[t.type];s&&e.insertAdjacentHTML("beforeend",s(t))}));